iOS/编程范式.html.body:
iOS 编程范式iOS 编程范式
泛型编程，即参数化类型，把一个原本特定于某个类型的算法或者类当中的类型信息抽象出来，使原本的算法适用范围更广。
从定义来看，面向对象语言都支持泛型编程，因为面向对象支持的多态特性就是泛型的具体实践。
swift 泛型
// T没有限制
func swap(a:inout T,b:inout T) {
    let tmp = a
    a = b
    b = tmp
}
// 明确的指明 T，有限制，T is a NSObject
func printObject(obj:T) {
    print(obj.description)
}
// 没有指明T，但是这还是泛型，也是多态
func printObject(obj:NSObject) {
    print(obj.description)
}
Objective-C 泛型
NSArray viewModels;

MyObject *obj = [[MyObject alloc] init];    
NSLog(@"%@",obj.obj);
泛型的另一个好处是减少了强制转换的频率。

