iOS/清理webview缓存.html.body:
清理webview缓存清理webview缓存
用户长期使用以后，webView可能会缓存大量的数据，占用用户手机的磁盘空间。因此必须提供一个功能用来清除缓存。
在iOS 8上使用，没有发现应用数据大小随着WKWebView的使用而增加，无需清除缓存，最多清除Cookies。
- (void)clearWebCache {
  NSString *libraryPath = [NSSearchPathForDirectoriesInDomains(NSLibraryDirectory, NSUserDomainMask, YES) objectAtIndex:0];
  NSString *cookiesFolderPath = [libraryPath stringByAppendingString:@"/Cookies"];
  NSError *errors;
  [[NSFileManager defaultManager] removeItemAtPath:cookiesFolderPath error:&errors];
}
iOS 12 WKWebView缓存存放位置 沙盒/Library/Caches/WebKit ,应用数据大小为60.1M，这个文件夹占用56.1，56.1M/60.1M = 93.3%，因此清除缓存的时候，移除这个文件夹就可以了。
视屏等MediaCache会存放在沙盒/tmp/WebKit下面,
// 针对iOS 9及以上的版本生效
- (void)clearWebCache {
    //allWebsiteDataTypes清除所有缓存
    NSSet *websiteDataTypes = [WKWebsiteDataStore allWebsiteDataTypes];
    NSDate *dateFrom = [NSDate dateWithTimeIntervalSince1970:0];
    [[WKWebsiteDataStore defaultDataStore] removeDataOfTypes:websiteDataTypes modifiedSince:dateFrom completionHandler:^{

    }];
}
// B 转成M NSString *size = [NSString fileSize / 1000.0 / 1000.0
- (unsigned long long)fileSize {

    // 总大小
    unsigned long long size = 0;
    // 文件管理者
    NSFileManager *mgr = [NSFileManager defaultManager];
    // 是否为文件夹
    BOOL isDirectory = NO;

    // 路径是否存在
    BOOL exists = [mgr fileExistsAtPath:self isDirectory:&isDirectory];
    if (!exists) return size;

    if (isDirectory) { // 文件夹
        // 获得文件夹的大小  == 获得文件夹中所有文件的总大小
        NSDirectoryEnumerator *enumerator = [mgr enumeratorAtPath:self];
        for (NSString *subpath in enumerator) {
            // 全路径
            NSString *fullSubpath = [self stringByAppendingPathComponent:subpath];
            // 累加文件大小
            size += [mgr attributesOfItemAtPath:fullSubpath error:nil].fileSize;
        }
    } else { // 文件
        size = [mgr attributesOfItemAtPath:self error:nil].fileSize;
    }
    return size;
}
@end

iOS/系统自带分享机制.html.body:
UIActivityViewControllerShare Extension现在分享功能已经成为App不可缺少的一部分，国内的集成SDK如友盟分享等比较流行，各个社交平台都有自己的分享SDK，集成这些SDK，就可以分享到对应的平台，但是集成步骤都比较繁琐。而相比之下，国外的开发者更倾向于使用iOS提供的系统级的Share Extension。
UIActivityViewController
通过UIActivityViewController可以唤起系统的分享界面，将数据传递给UIActivityViewController就可以进行分享。
NSString *textToShare = @"分享的标题。";
UIImage *imageToShare = [UIImage imageNamed:@"loading_error"];
NSURL *urlToShare = [NSURL URLWithString:@"http://www.baidu.com"];
NSArray *activityItems = @[textToShare,imageToShare, urlToShare];
UIActivityViewController *activityVC = [[UIActivityViewController alloc]initWithActivityItems:activityItems applicationActivities:nil];

//不出现在活动项目
activityVC.excludedActivityTypes = @[UIActivityTypePrint, UIActivityTypeCopyToPasteboard,UIActivityTypeAssignToContact,UIActivityTypeSaveToCameraRoll];
[self presentViewController:activityVC animated:YES completion:nil];

// 分享之后的回调
activityVC.completionWithItemsHandler = ^(UIActivityType  _Nullable activityType, BOOL completed, NSArray * _Nullable returnedItems, NSError * _Nullable activityError) {
    if (completed) {
        NSLog(@"completed");
        //分享 成功
    } else  {
        NSLog(@"cancled");
        //分享 取消
    }
};

Share Extension
在早先版本里，从iOS5到iOS6，乃至iOS7，分享插件的界面设计进过了几次变更，但是功能上一直十分有限，一开始仅限于系统级和系统原生应用的内容传递，例如发送照片内容到邮件和短信，或者从Safari保存网页等。后来苹果通过与Twitter和Facebook等几家公司签订独立的协议，实现了整合的方案，使内容分享到这些应用的过程更方便。但是苹果显然也意识到了这一点，即系统和应用，以及应用与应用之间传递内容信息的需求是用户真实存在的需求，需要一个真正系统级的解决方案，就像当年的Push Notification那样，一个方案解决所有App的问题，而不是一家一家地去签协议。
在 iOS 8 中，App开发者只需要在开发过程中，为App加入原生分享插件，向系统注册，就可以通过Extension来实现与系统和其他App的内容分享了。原生分享插件就相当于一个中间媒介，可以接受Host App（发送内容的App）提交的内容，转交给想要分享到的Containing App（接受内容的App）。

Extension 依赖于主项目，不能单独存在。创建了Share Extension后，再进行分享，就可以看到我们自己的App。

iOS/信鸽推送.html.body:
iOS 信鸽推送集成为什么这么简单iOS 信鸽推送集成为什么这么简单
推送不使用第三方SDK也是可以做的，但是现在一般都是集成第三方的推送服务，因为第三方的服务集成非常简单。这里研究一下信鸽SDK，说不定哪天自己做SDK也能借鉴一下。
推送SDK主要功能是注册推送、DeviceToken处理、推送接收处理等，最大的问题是系统版本不同，注册和接收的系统 API 不同。
 XGPush SDK 的启动的代码只有一行。
- (BOOL)application:(UIApplication *)application didFinishLaunchingWithOptions:(NSDictionary *)launchOptions {
    NSLog(@"application.delegate is %@",application.delegate);
    NSLog(@"%@",[UNUserNotificationCenter currentNotificationCenter].delegate);

    [[XGPush defaultManager] startXGWithAppID:self.appKey.longLongValue appKey:self.appSecret delegate:self];

    NSLog(@"application.delegate is %@",application.delegate);
    NSLog(@"%@",[UNUserNotificationCenter currentNotificationCenter].delegate);
    return YES;
}
为什么 SDK 不需要我们实现 - (void)application:(UIApplication *)application didRegisterForRemoteNotificationsWithDeviceToken:(NSData *)deviceToken 等方法呢？
我们先看看上面NSLog的输出，输出如下
application.delegate is 
(null)
application.delegate is 

可以看到 application.delegate 不再是 AppDelegate 的实例，而是 TencentXGPushAppDelegate 的实例。有了application.delegate 就可以封装和 application.delegate 相关的各种代码，对外只暴露必要的回调，所以接入代码非常简洁。

TencentXGPushAppDelegate

XGPush SDK hook 了 UIApplication 的 setDelegate: 方法，基于 setDelegate 方法的参数动态创建的一个类，新的类会继承自原有的 delegate ,一般这个类是 AppDelegate。
TencentXGPushAppDelegate 自己重新实现了 UIApplicationDelegate 协议中推送相关的方法，同时如果系统是iOS 10及之后，还实现了 UNUserNotificationCenterDelegate中的方法。在startXGWithAppID后，UNUserNotificationCenter的代理也被XGPush接管了，所以自己不需要实现 UNUserNotificationCenterDelegate 中的方法，实现了也没有用。

