NSConditionNSLockNSConditionLock信号量POSIXNSLockingiOS中以NS开头实现锁的有NSCondition、NSConditionLock、NSLock、NSRecursiveLock，其中NSCondition最为特别。

NSCondition的condition可以被忽略，那就和一般的锁没有区别.
NSConditionLock和NSCondition都可以实现条件锁，区别在于NSConditionLock自身持有一个条件，而NSCondition的条件依赖于外部变量
NSCondition展示了更多的细节

NSCondition
lock & checkpoint，即充当锁又充当检查点。
__block int flag = 0;

NSCondition *condition = [NSCondition new];

dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
    [condition lock];
    while (flag != 1) {
             // 阻塞当前线程，现在只能等待其他线程唤醒condition了
        [condition wait];
    }

    // 需要加锁保护的代码

    [condition unlock];
});

dispatch_after(dispatch_time(DISPATCH_TIME_NOW, (int64_t)(2 * NSEC_PER_SEC)), dispatch_get_main_queue(), ^{
    flag = 1;

    // 随机唤醒1个在等待 condition 的线程，可以多次调用，唤醒多个线程
    [cond signal];

    // 唤醒所有在等待 condition 的线程
    [cond broadcast];
});
可以看到，NSCondition可以主动进行wait/signal/broadcast。
在一个线程里加锁要考虑的问题：
1、加锁失败怎么处理？

lock 阻塞当前线程
